import React from "react";
// import 'bootstrap/dist/css/bootstrap.css';
// import 'bootstrap/dist/js/bootstrap.bundle';

class Libera extends React.Component {
    state = {  } 
    render() { 
        return (
            <nav class="navbar navbar-expand-lg bg-light">
            <div class="container-fluid">
                <a class="navbar-brand nav-head" href="#">
                    <img src="/images/navlogo.webp" alt="" width="30" height="24" class="d-inline-block align-text-top"/>Libera
                </a>
                    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                    <li class="nav-item">
                        <a class="nav-link" aria-current="page" href="#">FAQ's</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Teligram</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link">BUSD 3X Miner</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link">Liberata Bank</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link">Lambo Contest</a>
                    </li>
                    <li>
                        <button class="navBtn" type="button">Use ShibaSwap</button>
                    </li>
                    
                </ul>
               
                </div>
            </div>
</nav>
        );
    }
}
 
export default Libera;
